import React from "react"
import SearchBar from "./../components/SearchBar"
import SongCard from "./../components/SongCard"

function drawAlphabet () {
    let alphabet = ['#', 'A', 'B', 'C', 'D', 'E', 'F', 'G', 'H', 'I', 'J', 'K', 'L', 'M', 'N', 'Ñ', 'O', 'P', 'Q', 'R', 'S', 'T', 'U', 'V', 'W', 'X', 'Y', 'Z'];

    alphabet.map(letter => <a href="#${letter}">{letter}</a>)

}

export default function Songs(props) {
  let { SongsList } = props

  return (
    <section className="container-md">
      <div className="row">
        <div className="col-12">
          <SearchBar />
        </div>
      </div>

      <div className="row">
        <div className="col-11 songs">
          <div className="row" id="songs">
            {Object.entries(SongsList).map((element) => (
              <SongCard Song={element[1]} />
            ))}
          </div>
        </div>

        <div className="col-1 position-fixed alphabet" id="alphabet"></div>
      </div>
    </section>
  )
}
